function Leadership() {
  return (
    <section id="team" className="team section light-background">
      <div className="container section-title">
        <h2 style={{ color: "#1795ab" }}>Our Leadership</h2>
      </div>
      <div className="container">
        <div className="row gy-5">
          <div className="col-lg-6 col-md-6">
            <div className="member">
              <div className="member-info">
                <h4 style={{ color: "#1795ab" }}>Zohreh Sanaei (PhD)</h4>
                <span style={{ color: "#1795ab" }}>
                  Chief Experience Officer
                </span>
                <div className="social">
                  <a
                    href="https://www.linkedin.com/in/zohrehsanaei/"
                    target="_blank"
                    rel="noreferrer"
                  >
                    <i className="bi bi-linkedin"></i>
                  </a>
                </div>
                <p>Zohreh Sanaei is a visionary leader in AI and data science, dedicated to transforming complex challenges into seamless, data-driven solutions. With a PhD in Computer Science and over 12 years of experience, she specializes in driving AI innovation that enhances business performance and customer experiences.</p>
                <p> As Chief Experience Officer at AIThink LTD, Zohreh focuses on bridging the gap between AI technology and real-world applications. She excels at simplifying complex AI/ML models into actionable strategies, ensuring that businesses not only adopt AI but thrive with it. Her leadership fosters a culture of innovation, guiding teams to develop AI solutions that optimize processes, improve decision-making, and drive measurable success.</p>
                <p> Passionate about making AI accessible and impactful, Zohreh is committed to helping organizations harness the full potential of artificial intelligence—creating smarter, more efficient, and customer-centric experiences.</p>
              </div>
            </div>
          </div>


          <div className="col-lg-6 col-md-6">
            <div className="member">
              <div className="member-info">
                <h4 style={{ color: "#1795ab" }}>Saeid Abolfazli (PhD)</h4>
                <span style={{ color: "#1795ab" }}>
                  Co-Fouder
                </span>
                <div className="social">
                  <a
                    href="https://www.linkedin.com/in/saeidabolfazli/"
                    target="_blank"
                    rel="noreferrer"
                  >
                    <i className="bi bi-linkedin"></i>
                  </a>
                </div>
                <p>Saeid is an AI strategist, educator, and innovator dedicated to making AI practical and transformative for businesses. He leverages his deep expertise in AI/ML, data science, and technology leadership to help organizations integrate AI solutions that drive efficiency and growth.</p>
              <p> With a strong academic background, Saeid has been teaching AI and machine learning at the University of Toronto and the Vector Institute for AI, shaping the next generation of AI talent. His work bridges cutting-edge research with real-world applications, ensuring AI is not just innovative but also ethical and impactful.</p>
              <p>Saeid is committed to empowering businesses with AI-driven strategies that enhance decision-making, streamline operations, and create lasting value in an evolving digital landscape.</p>
              <p> Passionate about making AI accessible and impactful, Zohreh is committed to helping organizations harness the full potential of artificial intelligence—creating smarter, more efficient, and customer-centric experiences.</p>
              </div>
            </div>
          </div>


        </div>
      </div>
    </section>
  );
}

export default function HomePage() {
  return (
    <>
      <Header />
      <main>
        <Hero />
        <Mission />
        <Services />
        {/* <BusinessTransformation /> */}
        <Leadership />
      </main>
    </>
  );
}
